tables.table_schema:
CREATE TABLE therapy_interventions (
  intervention_id INT PRIMARY KEY,
  intervention_name VARCHAR(255),
  mental_health_condition VARCHAR(100),
  effectiveness_score FLOAT
);

CREATE TABLE therapy_conditions (
    condition_id INT PRIMARY KEY,
    condition_name VARCHAR(50),
    description TEXT
);

CREATE TABLE therapy_interventions (
    intervention_id INT PRIMARY KEY,
    intervention_name VARCHAR(50),
    duration_minutes INT,
    effectiveness_score FLOAT
);

CREATE TABLE therapist_info (
    therapist_id INT PRIMARY KEY,
    therapist_name VARCHAR(50),
    specialization VARCHAR(50)
);
